import "./portfolio.scss";


export default function Portfolio() {

  return (
    <>
      <div className="formations">
        <h1>Formations</h1>
        <div className="formation">
        <p className="year">2021 - 2022</p>
        <p className="city">Brest - France</p>
        <p className="diplome">2 ème année cycle d’ingénieur</p>
        <p className="ecole">École Nationale d’Ingénieurs de Brest (ENIB) (en cours)</p>
        </div>
      </div>
      </>
  );
}
